INSERT INTO [dbo].[WikiPage] ([Id], [Title], [Content], [LastModifed], [AuthorId]) VALUES (1, N'How Often Should You Clean Your Humidifier?', N'It''s the end of a long day, and you''ve grudgingly brushed, flossed, washed your face and performed other tedious tasks when you''d much rather just fall right in bed. Suddenly, the humidifier looms large. The tank is half full, so why not just save yourself an extra chore and re-use last night''s water? Then there''s the fact that a different president was in office the last time you performed a full clean of the small appliance, but surely, the water running through keeps it clean enough, right? As much as we hate to be Humidifier Henrietta, both of these common mistakes are actually risky for your overall health.  So why''s that? First off, you need to know what a humidifier is in the first place. There are a bunch of different types (warm-mist, cool-mist, ultrasonic), but they all shoot for the same goals of restoring moisture to the atmosphere to help people breathe better, relieving dry skin, stopping static electricity and even protecting your wooden furniture. Too little humidity is very common in the winter once the indoor heater gets cranked up, drying out the air and sometimes resulting in chapped lips, bloody noses and breathing issues. A warm mist humidifier can still provide heat without drying out the air in your room.', N'2020-04-22 09:00:00', 1)
INSERT INTO [dbo].[WikiPage] ([Id], [Title], [Content], [LastModifed], [AuthorId]) VALUES (2, N'Chimerism: You Can Be Your Own Twin', N'Taylor Muhl is a beautiful woman and a talented singer. She also happens to be a chimera, someone who carries two distinct sets of DNA, each with the genetic code to make a completely separate person. KEITH BERSON When Taylor Muhl, a California-based singer, asked a doctor to investigate the birthmark that demarcated the left side of her torso, she wondered what role the ruddy patch might play — if any — in a series of seemingly disparate health conditions she had experienced most of her life.  “Everything on the left side of my body is slightly larger than the right side,” Muhl says. “I have a double tooth in the left side of my mouth and many sensitivities and allergies to foods, medications, supplements, jewelry and insect bites.”', N'2020-05-05 22:45:00', 2)
